import{_ as t,c as n,b as i,w as _,d as r,e as s,a as c,r as o,o as f,f as p}from"./app.25b4d486.js";const V=JSON.parse('{"title":"我的22年回顾及23年规划","description":"","frontmatter":{"title":"我的22年回顾及23年规划","author":"teemwu","date":"2023/01/06 16:00","isPublished":true,"categories":["代码人生"],"tags":["总结"],"wordCount":1554},"headers":[{"level":1,"title":"我的22年回顾及23年规划","slug":"我的22年回顾及23年规划","link":"#我的22年回顾及23年规划","children":[{"level":2,"title":"22 年回顾","slug":"_22-年回顾","link":"#_22-年回顾","children":[{"level":3,"title":"22 年立的 flag","slug":"_22-年立的-flag","link":"#_22-年立的-flag","children":[]},{"level":3,"title":"22 年其它收获","slug":"_22-年其它收获","link":"#_22-年其它收获","children":[]}]},{"level":2,"title":"23 年规划","slug":"_23-年规划","link":"#_23-年规划","children":[{"level":3,"title":"23 年 flag","slug":"_23-年-flag","link":"#_23-年-flag","children":[]},{"level":3,"title":"23 年其它要做的事","slug":"_23-年其它要做的事","link":"#_23-年其它要做的事","children":[]}]}]}],"relativePath":"随笔/2023/我的22年回顾及23年规划.md","lastUpdated":1675042688000}'),u={name:"随笔/2023/我的22年回顾及23年规划.md"},g=r("h1",{id:"我的22年回顾及23年规划",tabindex:"-1"},[s("我的22年回顾及23年规划 "),r("a",{class:"header-anchor",href:"#我的22年回顾及23年规划","aria-hidden":"true"},"#")],-1),x=c('<p>或许是年纪大了，开始喜欢写总结了，还是懒的原因，这篇文章拖到了年初八，这么迟写总结的估计也没谁了。</p><h2 id="_22-年回顾" tabindex="-1">22 年回顾 <a class="header-anchor" href="#_22-年回顾" aria-hidden="true">#</a></h2><h3 id="_22-年立的-flag" tabindex="-1">22 年立的 flag <a class="header-anchor" href="#_22-年立的-flag" aria-hidden="true">#</a></h3><h4 id="_1-驾照-100" tabindex="-1">1. 驾照(100%) <a class="header-anchor" href="#_1-驾照-100" aria-hidden="true">#</a></h4><p>可能平时看太多交通事故的视频了，看出了心理阴影，对于学车一直很抵触，然而 21 年年初太闲了，鬼使神差就报名了驾校。报名的时候选的是最便宜的套餐，想着反正有的是时间，慢慢学。报完名交完费，去了一次练车，体验不好，就不去了。21 年年末交了女朋友，后来去一些地方玩，感觉打车太麻烦了，所以 22 年立了 flag ，一定要把照拿下。于是乎折腾了两个月，磕磕绊绊，最终还是拿到了驾照。经验之谈，当某件事你不想做，但始终还是要的，就先做了吧，不然越晚做，成本越高。</p><h4 id="_2-写文章-37-5" tabindex="-1">2. 写文章（37.5%） <a class="header-anchor" href="#_2-写文章-37-5" aria-hidden="true">#</a></h4><p>预想全年输出 24 篇文章的，平均每个月两篇，不算多，然而太懒，只完成了 9 篇。知识是零碎的，不去总结，不深度思考，很快就会淡忘。</p><h4 id="_3-开源节流-50" tabindex="-1">3. 开源节流（50%） <a class="header-anchor" href="#_3-开源节流-50" aria-hidden="true">#</a></h4><p>一直都有财富自由的梦，不过现实却非常骨感。交女朋友之后，自己开始变得精打细算了，因为要花费的地方太多，估计后面会更多。单一的工资收入来源，会让自己有危机感，因此，开源节流也提上了日程。22 年尝试了一些赚钱渠道，然而收入甚微，不过节流方面做得还是不错的。21 年年末开始了记账，从自己的账单入手，刨掉一些不必要的支出，22 年的支出还是在理想范围。</p><h4 id="_4-读书-100" tabindex="-1">4. 读书（100%） <a class="header-anchor" href="#_4-读书-100" aria-hidden="true">#</a></h4><p>22 年自己花在读书上的时间不多，不过好在一直在坚持。22 年读完了《墨菲定律》、《晚熟的人》、《小米创业思考》、《被讨厌的勇气》，每本书都有些许启发和收获。22 年疫情最后一年，也是打工人最艰难的一年，《被讨厌的勇气》最值得推荐。</p><h4 id="_5-英语词汇量7000-80" tabindex="-1">5. 英语词汇量7000（80%） <a class="header-anchor" href="#_5-英语词汇量7000-80" aria-hidden="true">#</a></h4><p>英语词汇量是阅读的关键，平时在看一些英语文档的时候很费劲，主要是词汇量太少了。22 年花了一段时间背单词，词汇量提升到 6000 左右，阅读英语文档轻松了许多，后续仍需加强。</p><h4 id="_6-坚持运动-100" tabindex="-1">6. 坚持运动（100%） <a class="header-anchor" href="#_6-坚持运动-100" aria-hidden="true">#</a></h4><p>身体健康就是财富，22 年一直保持阶段性锻炼，年度体检各项指标均正常，新冠杀入了决赛圈，至今还未阳，不知是不是跟经常锻炼有关。</p><h4 id="_7-和女友去旅游-100" tabindex="-1">7. 和女友去旅游（100%） <a class="header-anchor" href="#_7-和女友去旅游-100" aria-hidden="true">#</a></h4><p>原本计划出省走走的，可是疫情反反复复，最后还是没有踏出广东省一步。不过这一年也没停过，把周边的小景点都跑了一遍，保持每个月都有出行。</p><h4 id="_8-提桶-0" tabindex="-1">8. 提桶（0%） <a class="header-anchor" href="#_8-提桶-0" aria-hidden="true">#</a></h4><p>这个 flag 基本上是年年都立，然而一直没有完成。深知温室的危害，一直想走出去，就如《被讨厌的勇气》所说，讨厌现状却没有勇气去改变。各大公司的裁员，把我 22 年要提桶的想法打消了。</p><h3 id="_22-年其它收获" tabindex="-1">22 年其它收获 <a class="header-anchor" href="#_22-年其它收获" aria-hidden="true">#</a></h3><h4 id="_1-继续教育" tabindex="-1">1. 继续教育 <a class="header-anchor" href="#_1-继续教育" aria-hidden="true">#</a></h4><p>九月份报了升本，开始了自我救赎之旅。经过社会的毒打，从自命不凡，到慢慢接受平凡的自己。生活不像那些热血煞笔的番，不是人人都是男主，没有转世重来的超能力，我们能做的只有好好规划自己的未来。“人无远虑，必有近忧”，不知道投资什么，就投资自己吧。</p><h4 id="_2-买车与否" tabindex="-1">2. 买车与否 <a class="header-anchor" href="#_2-买车与否" aria-hidden="true">#</a></h4><p>八月拿了驾照就开始想买车，之前一直都没有了解车相关的资讯，经过两个多月的了解，有点想买辆比亚迪。去 4S 店看了，价格什么的都没有降，而且等车要很久，到了 12 月去看，说是要涨价，让赶紧下订。后面认真想了下，现阶段自己还不需要一辆车，所以就继续观望吧。根据网上整理的资料可知，养车的成本要 2000 左右一个月，而自己打车出行根本不需要整么多钱，加上电车价格现在有点不稳定，不买立省 20 万😂，这也算是一种收获吧。</p><h4 id="_3-第一次见家长" tabindex="-1">3. 第一次见家长 <a class="header-anchor" href="#_3-第一次见家长" aria-hidden="true">#</a></h4><p>国庆假期，完成了第一次见家长。见面时感觉有一点点局促，不过整体还好，比较头疼的还是去之前礼物的购买。做了大量功课，最后得出的结论是：根据家庭成员的喜好，购买相关的礼物，如果有小朋友的话，需要买一些小朋友喜欢的玩具或者零食。</p><h4 id="_4-第一次述职" tabindex="-1">4. 第一次述职 <a class="header-anchor" href="#_4-第一次述职" aria-hidden="true">#</a></h4><p>工作了这么多年，还是第一次述职。花了几天时间整理了 22 年的工作情况，并将述职目录分为了“项目说明及成果总结”、“经验教训总结”和“未来规划”三大块，以 PPT 的形式进行演讲。虽说不是第一次讲 PPT，但一进去一排人对你评分，向你提问，紧张是难免的。经过复盘，自己还需要改进的是，要更精简 PPT 内容，突出重点数据，准备演讲草稿，最好是脱稿进行演讲。</p><h2 id="_23-年规划" tabindex="-1">23 年规划 <a class="header-anchor" href="#_23-年规划" aria-hidden="true">#</a></h2><h3 id="_23-年-flag" tabindex="-1">23 年 flag <a class="header-anchor" href="#_23-年-flag" aria-hidden="true">#</a></h3><ol><li>读书</li><li>运动</li><li>输出文章 24 篇</li><li>开源节流</li><li>考证-软考高级</li><li>学会游泳</li><li>英语词汇量 8000</li><li>两次省外旅游</li><li>带父母做一次体检</li><li>提桶</li></ol><h3 id="_23-年其它要做的事" tabindex="-1">23 年其它要做的事 <a class="header-anchor" href="#_23-年其它要做的事" aria-hidden="true">#</a></h3><ol><li>技术开源，多为技术社区做贡献</li><li>系统性学习产品思维，打造属于自己的产品</li></ol><p>疫情过去了，留下了什么？第一次写个人总结文章，简简单单的生活，记录一下过去，展望一下未来，相信 2023 会更好。</p>',34);function b(a,e,m,v,P,T){const l=p,d=o("ClientOnly");return f(),n("div",null,[g,i(d,null,{default:_(()=>[i(l,{modelValue:a.$frontmatter,"onUpdate:modelValue":e[0]||(e[0]=h=>a.$frontmatter=h)},null,8,["modelValue"])]),_:1}),x])}const C=t(u,[["render",b]]);export{V as __pageData,C as default};
